INSERT INTO `eb_history` VALUES (1,'2015-08-20 12:00:00','2015-08-20 14:00:00','03','１、ＤＢ設計\r\n２、環境構築',NULL,0),(2,'2016-01-19 13:10:00','2016-01-19 14:59:00','01','１、AWSサーバの設定\r\n２、favicon.ico追加など',NULL,0),(3,'2016-01-20 11:00:00','2016-01-20 15:50:00','01','１、AWSでApache2の設定をProxyからmod_wsgiに変更しました。\r\n２、メンバーの基準時間の既定値は案件の基準時間に設定する。',NULL,0),(4,'2016-01-21 12:45:00','2016-01-21 14:45:00','01','１、案件の売上情報画面の追加',NULL,0),(5,'2016-01-23 04:00:00','2016-01-23 18:45:00','01','１、案件の売上情報の作る\r\n２、社員稼働及びリリース情報のメース通知',NULL,0),(6,'2016-01-24 03:00:00','2016-01-24 05:30:32','01','１、営業メンバーに対するメール通知',NULL,0),(7,'2016-01-25 11:00:00','2016-01-25 15:31:20','01','１、画面「協力会社」の追加\r\n２、註文書の作成',NULL,0),(8,'2016-01-26 11:10:00','2016-01-26 15:10:38','01','１、註文書の作成',NULL,0),(9,'2016-01-27 10:18:15','2016-01-27 15:54:42','01','１、註文書のメンバー部分の出力',NULL,0),(10,'2016-01-28 09:41:34','2016-01-28 12:15:00','02','１、ＢＭメンバー情報入力画面ずれの修正\r\n２、ＥＢ注文書テンプレートの調整\r\n３、デプロイ',NULL,0),(11,'2016-01-28 13:15:17','2016-01-28 16:00:00','01','１、注文書の生成',NULL,0),(12,'2016-01-30 04:14:49','2016-01-30 07:00:00','01','１、註文書の出力をopenpyxlからWinAPIに変更しました。\r\n２、他社技術者はコストを編集できるように。\r\n３、他社技術者の注文情報にコスト項目を追加した。',NULL,0),(13,'2016-01-31 03:00:00','2016-01-31 04:23:17','01','１、売上情報の出力',NULL,0),(14,'2016-01-31 05:28:05','2016-01-31 05:45:49','01','１、精算書の名称を変更',NULL,0),(15,'2016-01-31 12:15:09','2016-01-31 15:33:12','01','１、課題管理票の画面を追加\r\n２、売上情報画面の不具合修正（取引先の絞り込み条件の修正）',NULL,0),(16,'2016-02-01 01:15:05','2016-02-01 03:00:30','02','不具合修正\r\n１、交通費が出ない\r\n２、案件詳細画面エラー',NULL,0),(17,'2016-02-01 12:34:48','2016-02-01 15:00:41','01','１、支払日は３０日で、２月の場合のエラー修正',NULL,0),(19,'2015-08-21 02:05:00','2015-08-21 03:00:00','03','１、画面追加',NULL,0),(20,'2015-08-21 05:00:00','2015-08-21 10:00:00','03','１、画面追加',NULL,0),(21,'2015-08-21 11:00:00','2015-08-21 14:00:00','03','１、画面追加',NULL,0),(22,'2015-08-23 12:00:00','2015-08-23 14:30:00','03','１、rhcloudにリリース',NULL,0),(23,'2015-08-24 05:00:00','2015-08-24 10:30:00','03','１、画面「リリース状況一覧」追加する',NULL,0),(24,'2015-08-25 00:00:00','2015-08-25 03:00:00','03','１、画面レイアウトのデザイン\r\n２、ホームページの設計',NULL,0),(25,'2015-08-25 04:00:00','2015-08-25 07:00:00','03','１、ステータスによる条件の絞り込み\r\n２、管理サイトの画面レイアウトの調整',NULL,0),(26,'2015-08-26 00:00:00','2015-08-26 03:00:00','03','１、稼働状態と営業状態の設計\r\n２、要員一覧画面の名前の絞り込み\r\n３、案件一覧画面の名前の絞り込み',NULL,0),(27,'2015-08-26 04:00:00','2015-08-26 09:00:00','03','１、案件一覧画面の関連会社の絞り込み\r\n２、お取引先の社員ＤＢを追加する\r\n３、案件の責任者と連絡者を追加する',NULL,0),(28,'2016-02-03 11:02:26','2016-02-03 12:52:43','01','１、月の売上情報の対象月の取得',NULL,0),(29,'2016-02-15 11:30:37','2016-02-15 14:00:18','01','１、普通のメンバーに対して、ユーザを作成できるように',NULL,0),(30,'2016-02-16 11:48:30','2016-02-16 14:20:55','01','１、普通のログイン画面を作成する。',NULL,0),(31,'2016-02-24 09:00:07','2016-02-24 09:46:18','02','１、会社のＩＰが変更したので、ＡＷＳのＤＢに繋がらなかった。',NULL,0),(32,'2016-02-24 12:00:42','2016-02-24 13:16:07','01','１、重构请求书的生成',NULL,0),(33,'2016-02-29 11:52:52','2016-02-29 13:00:09','01','１、重构请求书的生成',NULL,0),(34,'2016-03-07 04:26:27','2016-03-07 14:00:27','02','１、データの整理\r\n２、請求番号が一緒の不具合修正',NULL,0),(35,'2016-03-08 13:00:19','2016-03-08 13:45:48','01','不具合修正\r\n１、稼働中人数不正',NULL,0),(36,'2016-03-09 13:10:16','2016-03-09 16:00:00','01','チャート追加',NULL,0),(37,'2016-03-10 13:10:18','2016-03-10 14:11:18','01','チャート追加',NULL,0),(38,'2016-03-11 10:34:50','2016-03-11 13:17:35','01','チャート追加',NULL,0),(39,'2016-03-12 09:30:10','2016-03-12 10:46:36','01','売上情報を修正',NULL,0),(40,'2016-04-04 10:22:28','2016-04-04 11:22:28','02','不具合修正',NULL,0),(41,'2016-04-25 10:11:39','2016-04-25 13:05:16','02','１、案件一覧画面の絞込み条件に営業員とステータスは同時に効きません。\r\n２、案件一覧に終了リンクを追加しました。',NULL,0),(42,'2016-04-26 11:15:22','2016-04-26 13:15:24','04','１、案件更新時、要員の「営業員」を自動設定。\r\n２、協力社員の稼働状況追加\r\n３、要員一覧で部署による検索',NULL,0),(43,'2016-05-02 11:10:10','2016-05-02 15:22:10','04','不具合修正\r\n営業員としてログイン時,エラーになる',NULL,0),(44,'2016-05-06 04:00:00','2016-05-06 13:30:37','02','入退場リスト画面の追加\r\n時給の請求書作成など。',NULL,0),(45,'2016-05-09 13:00:00','2016-05-09 13:30:00','04','不具合修正\r\n１、協力社員の待機人数表示不正\r\n２、作成された請求書の印鑑欄の高さ不正',NULL,0),(46,'2016-05-11 13:00:00','2016-05-11 15:14:49','04','作成された請求書をサーバに保存',NULL,0),(47,'2016-05-12 12:30:41','2016-05-12 14:14:30','04','１、作成された請求書をサーバに保存\r\n２、課題管理票画面の再設計\r\n３、印刷CSSの設定',NULL,0),(48,'2016-05-13 13:30:05','2016-05-13 14:14:21','04','URL設定',NULL,0),(49,'2016-05-17 05:00:40','2016-05-17 10:15:00','02','機能改善、不具合修正、\r\nデプロイ',NULL,0),(50,'2016-05-18 13:00:00','2016-05-18 15:30:00','04','部署別売上画面追加',NULL,0),(51,'2016-05-19 12:30:00','2016-05-19 15:01:44','04','部署別売上画面追加',NULL,0),(52,'2016-05-21 04:00:00','2016-05-21 05:52:45','04','履歴書の修正 １、氏名の修正\r\n２、作業期間の修正\r\n３、生年月日の修正',NULL,0),(53,'2016-05-21 06:31:37','2016-05-21 10:54:43','04','部署配下のメンバーの売上計算',NULL,0),(54,'2016-05-22 02:30:00','2016-05-22 06:30:30','04','売上情報',NULL,0),(55,'2016-05-22 07:00:00','2016-05-22 10:30:00','04','売上情報',NULL,0),(56,'2016-05-23 10:30:00','2016-05-23 12:41:08','02','デプロイ\r\nvm環境構築',NULL,0),(57,'2016-05-24 02:00:00','2016-05-24 03:00:00','03','請求書作成時、履歴を保存する。',NULL,0),(58,'2016-05-24 04:00:00','2016-05-24 08:30:00','03','請求書作成時、履歴を保存する。',NULL,0),(59,'2016-05-24 14:00:00','2016-05-24 15:00:00','04','VM環境の構築',NULL,0),(60,'2016-05-25 12:00:00','2016-05-25 13:30:00','03','請求書の画面表示',NULL,0),(61,'2016-05-26 06:10:15','2016-05-26 09:10:50','03','請求書の画面表示',NULL,0);
