INSERT INTO `eb_issue` VALUES (1,'注文書の作成','協力社員の注文書の作成\r\n2016/4/4:\r\n案件単位に作成する。','2','2016-01-31 15:24:18','2016-04-06 07:27:11',1,NULL,0,NULL,1,NULL,NULL,NULL),(2,'精算条件发生变化','精算書中当精算条件发生变化时，如果会过头来生成上个月或更早的精算书的话，会导至生成出来的数字不对','3','2016-01-31 15:41:06','2016-05-25 13:26:54',1,NULL,0,'2016-05-31',1,'2016-05-31',17,'案件請求見出し(ProjectRequestHeading)と\r\n案件請求明細　(ProjectRequestDetail)の追加する。\r\n請求書を生成時、請求の明細情報（各メンバーの請求金額、精算金額等）を格納する。'),(3,'管理员邮箱','发送邮件提示需要有专门的邮箱','1','2016-02-01 11:40:04','2016-02-01 11:40:04',1,NULL,0,NULL,1,NULL,NULL,NULL),(4,'在服务器上保存生成的文件','在生成请求书或注文书时等时，能够自动保存一份备份到服务器，下次再下载时，会提示直接下载已经生成过的文件。','4','2016-02-01 14:07:34','2016-05-17 09:58:11',1,NULL,0,'2016-05-17',1,'2016-05-17',17,'作成されたファイルをサーバに保存しました。\r\n次回作成時、既存のファイルをダウンロードという選択ができる。'),(5,'請求番号が一緒','同じ案件で複数の注文書がある場合、生成された請求書の請求番号が一緒です。','4','2016-03-04 03:56:07','2016-03-11 13:16:42',1,NULL,0,NULL,1,NULL,NULL,NULL),(6,'社員番号','１、社員番号を給料王に一致する。\r\n２、協力社員の番号を自動生成','1','2016-03-07 06:20:53','2016-05-02 14:02:42',1,NULL,0,NULL,1,NULL,NULL,NULL),(7,'要员的营业员の自動設定','在设置完案件的营业员后自动设置要员的营业员为案件的营业员','3','2016-03-23 10:56:06','2016-04-26 11:58:57',1,NULL,0,NULL,1,NULL,NULL,NULL),(8,'外協の稼動状況','ＨＯＭＥ画面で協力社員の稼動情報を追加する。','2','2016-03-23 11:07:37','2016-05-25 00:11:10',1,NULL,0,'2016-06-30',1,NULL,17,''),(9,'今月リリース人数が不正','今月リリースだが、来月がすでに現場が決まっている、来月にすぐアサイン済みの場合も今月リリース一覧に出ている。','4','2016-03-29 04:33:38','2016-03-29 04:33:44',1,NULL,0,NULL,1,NULL,NULL,NULL),(10,'新規入場要員の切り分け','来月以降から稼働の要員が、待機リストに出ないように調整する','3','2016-04-09 09:21:20','2016-05-06 06:00:21',1,NULL,0,NULL,1,NULL,NULL,NULL),(11,'入退場リストの作成','月次単位来月入場と今月退場要員リストの自動作成','3','2016-04-09 09:22:39','2016-05-06 13:02:17',1,NULL,0,NULL,1,NULL,NULL,NULL),(12,'各統計データ検査条件の修正','統計データに、営業・部門のフィールド条件を追加したい','4','2016-04-09 09:24:28','2016-05-23 04:16:55',1,NULL,0,'2016-05-22',1,'2016-05-23',17,'No.17と一緒です。\r\n本件はクローズとし、No.17をご確認ください。'),(13,'離職予定要員の自動削除（来月）','部署が「離職予定」になった要員が、翌月の1日に自動的に離職状態に変更する','1','2016-04-09 09:25:59','2016-04-09 09:25:59',1,NULL,0,NULL,1,NULL,NULL,NULL),(14,'請求に作成時時給の自動算出','要員アサイン時、単価じゃなくて、時給になっているので、請求書作成時、請求金額を自動的算出してほしいです。','4','2016-04-14 06:14:56','2016-05-06 10:15:24',1,NULL,0,NULL,1,NULL,NULL,NULL),(15,'案件一覧画面の終了設定','案件一覧画面で直接終了と設定できるよう、わざわざ編集ボタンをクリックして、ステータスを完了に選択する必要がない。','4','2016-04-26 00:59:46','2016-04-26 00:59:54',1,NULL,0,NULL,1,NULL,NULL,NULL),(16,'注文書の金額表示','案件一覧画面に注文書の金額を表示する。','1','2016-04-26 12:01:02','2016-04-26 12:01:02',1,NULL,0,NULL,1,NULL,NULL,NULL),(17,'統計帳票の出力','「提出者：蒋さん、纏め者：4部　趙H」\r\n\r\n「要件」\r\n統計データが出力されること。\r\n「経緯」\r\n統計データの参照、分析、管理を行うため。\r\n「機能」\r\n・画面名＆帳票名：売上情報＞統計情報一覧\r\n・統計情報一覧が画面出力されること\r\n・統計情報一覧が印刷されること。\r\n「仕様詳細」\r\n・検索行：姓、名、部署、案件名称、関連会社、営業担当、請求金額、期間\r\n・タイトル行：名前　部署　案件名称　関連会社　営業担当　請求金額※１　日付※２\r\n・※１請求金額表示＆検索パタン\r\n　①人件費用（残業代含め）+交通料+税の合計\r\n　②人件費用（残業代含め）/交通料/税別\r\n・※２日付の表示例：2016年/05月/01日\r\n・その他イベント：帳票の各タイトルを押下したら、自動でソートされること。\r\n','2','2016-05-12 08:55:35','2016-05-19 04:34:14',1,NULL,0,'2016-05-23',1,NULL,17,''),(18,'リリース状況の表示について','「提出者：丁鈴、纏め者：4部　趙H」\r\n下記の要件も追加希望です。\r\n・今月営業必須の社員情報のみ、「リリース状況一覧」画面に表示できる。\r\n・今月営業不要の社員情報は、営業開始予定月が「リリース状況一覧」画面に表示でき、営業開始予定月を指定した上で、社員情報も参照できる。','4','2016-05-13 03:24:32','2016-05-13 03:34:07',12,NULL,0,NULL,1,NULL,NULL,NULL),(19,'営業緊急、営業不要の社員情報もリリース状況一覧へ反映','「提出者：丁鈴　記入者：4部　趙H」\r\n下記の機能も追記希望です。\r\n・今月営業要の社員情報のみ、優先順位で表示できる。\r\n・今月営業不要であれば、営業予定日を指定した上で、月別で社員情報は一覧できる。','1','2016-05-13 03:29:08','2016-05-13 03:31:44',12,NULL,0,NULL,1,NULL,NULL,NULL),(20,'新入社員と営業担当者が自動的に紐付け','「提出者：劉Cさん、記入者：4部　趙H」\r\n管理サイト＞社員で新入社員情報を追加したときに、営業担当を指定しないため、初回で「要員をアサイン」にするとき、新入社員と営業担当者の紐付けもできるように\r\n\r\n⇒蒋さん：社員情報編集画面で営業員より紐付けをするとなりますので、現時点で対応不要です。\r\n\r\n\r\n','4','2016-05-13 09:01:08','2016-05-17 08:15:03',12,NULL,0,NULL,1,NULL,NULL,'');
