DROP TABLE IF EXISTS `eb_member`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eb_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_id` varchar(30) NOT NULL,
  `first_name` varchar(30) NOT NULL,
  `last_name` varchar(30) NOT NULL,
  `first_name_ja` varchar(30) DEFAULT NULL,
  `last_name_ja` varchar(30) DEFAULT NULL,
  `first_name_en` varchar(30) DEFAULT NULL,
  `last_name_en` varchar(30) DEFAULT NULL,
  `sex` varchar(1) DEFAULT NULL,
  `country` varchar(20) DEFAULT NULL,
  `birthday` date DEFAULT NULL,
  `graduate_date` date DEFAULT NULL,
  `join_date` date,
  `email` varchar(254) DEFAULT NULL,
  `private_email` varchar(254) DEFAULT NULL,
  `post_code` varchar(7) DEFAULT NULL,
  `address1` varchar(200) DEFAULT NULL,
  `address2` varchar(200) DEFAULT NULL,
  `nearest_station` varchar(15) DEFAULT NULL,
  `years_in_japan` int(11) DEFAULT NULL,
  `phone` varchar(11) DEFAULT NULL,
  `is_married` varchar(1) DEFAULT NULL,
  `japanese_description` longtext,
  `certificate` longtext,
  `skill_description` longtext,
  `comment` longtext,
  `member_type` int(11) NOT NULL,
  `cost` int(11) NOT NULL,
  `company_id` int(11) DEFAULT NULL,
  `salesperson_id` int(11) DEFAULT NULL,
  `section_id` int(11) DEFAULT NULL,
  `subcontractor_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `is_retired` tinyint(1) NOT NULL,
  `deleted_date` datetime DEFAULT NULL,
  `is_deleted` tinyint(1) NOT NULL,
  `coordinate_update_date` datetime DEFAULT NULL,
  `lat` varchar(25) DEFAULT NULL,
  `lng` varchar(25) DEFAULT NULL,
  `is_notify` tinyint(1) NOT NULL,
  `notify_type` int(11),
  `is_individual_pay` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `employee_id` (`employee_id`),
  UNIQUE KEY `user_id` (`user_id`),
  KEY `eb_member_company_id_76581a6b_fk_eb_company_id` (`company_id`),
  KEY `eb_member_611cf3bd` (`salesperson_id`),
  KEY `eb_member_730f6511` (`section_id`),
  KEY `eb_member_9894ca87` (`subcontractor_id`),
  CONSTRAINT `eb_member_company_id_76581a6b_fk_eb_company_id` FOREIGN KEY (`company_id`) REFERENCES `eb_company` (`id`),
  CONSTRAINT `eb_member_salesperson_id_3ee6e133_fk_eb_salesperson_id` FOREIGN KEY (`salesperson_id`) REFERENCES `eb_salesperson` (`id`),
  CONSTRAINT `eb_member_section_id_77da938b_fk_eb_section_id` FOREIGN KEY (`section_id`) REFERENCES `eb_section` (`id`),
  CONSTRAINT `eb_member_subcontractor_id_1f2bb4f1_fk_eb_subcontractor_id` FOREIGN KEY (`subcontractor_id`) REFERENCES `eb_subcontractor` (`id`),
  CONSTRAINT `eb_member_user_id_3f789cf0_fk_auth_user_id` FOREIGN KEY (`user_id`) REFERENCES `auth_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=898 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

